import { Outlet, Link } from "react-router-dom";

const Onboard = () => {
  return (
    <>

        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/Login">Login</Link>
          </li>
          <li>
            <Link to="/Signup">Sign up</Link>
          </li>
        </ul>


      <Outlet />
    </>
  )
};

export default Onboard;
